import { GetProductsAction, GetProductsSuccessAction, GetProductsErrorAction, isLoggedIn} from "../interfaces";

export enum ProductActionType {
  getProducts,
  getProductsSuccess,
  getProductsError
}
export enum UserActionType {
  isLoggedIn,
  getUser,
  getUserError
}

export type ProductAction = GetProductsAction | GetProductsSuccessAction | GetProductsErrorAction
export type UserAction = isLoggedIn
